id: 431_CPDoS
info:
  name: Compare Response Codes
  author: raff
  severity: high
  description: Fuzzing 

http:
  - raw:
      - |
        GET {{BaseURL}}?cachetest1=H1raff1 HTTP/1.1
        Host: {{Hostname}}
      - |
        GET {{BaseURL}}?cachetest2=H1raff2 HTTP/1.1
        Host: {{Hostname}}
        X-Oversize-Hedear: Big-      
      - |
        GET {{BaseURL}}?cachetest2=H1raff2 HTTP/1.1
        Host: {{Hostname}}
        X-Oversize-Hedear: Big-
      - |
        GET {{BaseURL}}?cachetest2=H1raff2 HTTP/1.1
        Host: {{Hostname}}
    req-condition: true

    matchers-condition: and
    matchers:
      - type: dsl
        dsl:
          - 'status_code_4 != status_code_1 && status_code_4 != 403 && status_code_4 != 429 && status_code_4 != 200 && status_code_4 != 301 && status_code_4 != 302 && status_code_4 != 307 && status_code_4 != 308 && status_code_4 == status_code_3'
